import React from "react";
import Card from "./card";
import {asphaltBall, basketBall, footyBall, grassBall, volleyBall} from "./img/export";

class CardList extends React.Component {
    constructor() {
        super();
        this.state = {
            searchBox:''
        }
    }
    onSearchboxChange = (event) =>
        this.setState({searchBox:event.target.value})

    render() {
        return (
            <div className="parent">
                <div className = 'pa2 mw-30'>
                    <input
                        className ='pa3 ba b--green  bg-lightest-blue'
                        type='search'
                        placeholder='search balls'
                        onChange ={this.onSearchboxChange}/>
                </div>
                {"basketBall".includes(this.state.searchBox) ?
                    <div className="zone">
                        <Card ballType={basketBall} sport={"basketball"}/>
                    </div> : <div></div>
                }
                {"futsal ball".includes(this.state.searchBox) ?
                    <div className="zone">
                        <Card ballType={asphaltBall} sport={"futsal ball"}/>
                    </div> : <div></div>
                }
                {"footyvolley ball".includes(this.state.searchBox) ?
                    <div className="zone">
                        <Card ballType={footyBall} sport={"footyvolley ball"}/>
                    </div> : <div></div>
                }
                {"volleyBall".includes(this.state.searchBox) ?
                    <div className="zone">
                        <Card ballType={volleyBall} sport={"volleyBall"}/>
                    </div> : <div></div>
                }
                {"soccer ball".includes(this.state.searchBox) ?
                    <div className="zone">
                        <Card ballType={grassBall} sport={"soccer ball"}/>
                    </div> : <div></div>
                }
            </div>

        );
    }
}
export default CardList;
